import axios from "axios";

const SearchImages = () => {
  axios.get("https://api.spoonacular.com/recipes/complexSearch", {
    headers: {
      "Content-Type": "application/json",
    },
    params: {
      query: "pasta",
    },
  });

  return response;
};

export default App;
